import React from "react";
import Movie from "./Movie/Movie";

const Movies = (props) => {
  return (
      <ul>
{
      props.movies.map((movie) => {
          <Movie key={movie.id} title={movie.title}/>
        })}
        </ul>);
};

export default Movies;
